  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset includes all requests for
  service received from the City-Parish 311 Call Center, including requests for service
  submitted online and through the Red Stick 311 mobile application, dating back to
  January 1, 2016. Submitter names, phone numbers, and e-mail addresses are redacted
  for privacy purposes. Data is updated daily from the Public Works Business Office
  and 311 Call Center.rnrnPhone numbers are redacted to protect the contact information
  and privacy of citizens by replacing raw digits with XXX-XXX-XXXX. For any questions
  about this process, please contact opendata@brgov.com.\",\n\t\"license_title\":
